import './App.css'

function List(props) {
  return (
    <>
      {!props.animals && <div>Loading...</div>}
      {props.animals && (
        <ul>
          {props.animals.map((animal) => {
            return <li key={animal}>{animal}</li>
          })}
        </ul>
      )}
      {props.animals && props.animals.length === 0 && (
        <div>There are no animals in the list!</div>
      )}
    </>
  )
}

function App() {
  const animals = [1]

  return (
    <div>
      <h1>Animals: </h1>
      <List animals={animals} />
    </div>
  )
}

export default App
